import styled from "styled-components";

type BoxPicturePropsType = {
	pict: string
}

export const BoxPicture = styled.div<BoxPicturePropsType>`
  width: 280px;
  height: 170px;
  margin: 10px 10px 20px 10px;
  border-radius: 10px;
  background: image(${props => props.pict});
`
